import { Box, HStack, Image, Text } from "native-base"
import React from "react"

const Containers = () => {
  return (
    <Box>
      <Image
        style={{ width: 250, height: 250 }}
        source={require("./assets/images/hero.png")}
      />
      <HStack>
        <Text>Ways</Text>
        <Text>ToDO</Text>
      </HStack>
    </Box>
  )
}

export default Containers
